scripts:
var navitems = document.querySelectorAll(".navigation-subItemLink");
var mobile = window.matchMedia("(max-width: 1024px)");

for (var i = 0; i < navitems.length; i++) {
    var el = navitems[i];
    if (mobile.matches) {
        var url = el.getAttribute("data-href");
        el.setAttribute("href", url);
    }
}

if (window.dataLayer) {
    var hasScheme = false;
    for (var i = 0; i < window.dataLayer.length; i++) {
        if (window.dataLayer[i].SchemaFacet) {
            hasScheme = true;
            break;
        }
    }

    if (!hasScheme) {
        window.dataLayer.push({
            "SchemaFacet": '{00000000-0000-0000-0000-000000000000}',
        });
    }
}

var overlayState = {
    accepted: sessionStorage.getItem('acceptedBrowser')
}

var link = document.getElementById("overlayPromptLink");
var okay = document.getElementById("overlayPromptOkay");
var overlay = document.getElementById("browserOverlayPrompt");

link.addEventListener("click", function (e) {
    sessionStorage.setItem('acceptedBrowser', true);

    overlayState.accepted = true;
})

okay.addEventListener("click", function (e) {
    sessionStorage.setItem('acceptedBrowser', true);

    overlayState.accepted = true;

    if (overlayState.accepted) {
        overlay.classList.add("hide");
    }

    e.preventDefault();
})

if (window.document.documentMode) {
    if (overlay.classList.contains("hide") && !overlayState.accepted) {
        overlay.classList.remove("hide");
    }
} else {
    overlay.classList.add("hide");
}

